import React from 'react'
import styled from 'styled-components'

const StyledHeader = styled.ul`
  display: flex;
  align-items: center;
  justify-content: space-between;
`

const Header = (props) => {
  return (
    <StyledHeader class="header-container">  
      { props.items.map(elem => <li> { elem.title } </li>) }
    </StyledHeader>
  )
}

export default Header
